import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';
import CatService from './services/CatService.js'

function App() {

  let catDataList = []

  // const [imageUrl, imageState] = useState()
  const getTheCats = () => {
    let cServ = new CatService()
    catDataList = cServ.fetch10Cats()
  }

  return (
    <div className="App">

      {/* <button onClick={getCatData}>get</button> */}

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <div className="container">

      {
        catDataList.map(({id, src}) => <img key={id} src={src} className="item"/>)
      }

        {/* <img  src="" alt="Example image" /> */}
        {
          /* <img class="item" src="https://source.unsplash.com/random/320x240" alt="Example image" />
          <img class="item" src="https://source.unsplash.com/random/320x240" alt="Example image" /> */
        }
      </div>
    </div>
  );
}

export default App;
